import "./Chart.css";
import ChartBar from "./ChartBar";
const Chart = (props) => {
  const datapoints = [
    { label: "Jan", value: 0 },
    { label: "Feb", value: 0 },
    { label: "Mar", value: 0 },
    { label: "Apr", value: 0 },
    { label: "May", value: 0 },
    { label: "Jun", value: 0 },
    { label: "Jul", value: 0 },
    { label: "Aug", value: 0 },
    { label: "Sep", value: 0 },
    { label: "Oct", value: 0 },
    { label: "Nev", value: 0 },
    { label: "Dec", value: 0 },
  ];

  return (
    <div className="chart">
      {datapoints.map((datapoint) => {
        <ChartBar datapoint={datapoint} />;
      })}
    </div>
  );
};
export default Chart;
